import React from "react";

function GameModes() {
  return (
    <div style={{ textAlign: "center" }}>
      <h1>Game Modes</h1>
      <button style={{ margin: "10px" }}>Follow the Path</button>
      <button style={{ margin: "10px" }}>Free Play</button>
    </div>
  );
}

export default GameModes;
